// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LandingPage from "./pages/LandingPage";
import LoginPageAdmin from "./pages/LoginPageAdmin"; 
import LoginPageChimiste from "./pages/LoginPageChimiste"; // Chemist login
import LoginPagePharma from "./pages/LoginPagePharma"; // Pharmacist login
import LoginPageDev from "./pages/LoginPageDev"; // Developer login
import PrivateRoute from "./components/PrivateRoute";
import Dashboard from "./pages/Dashboards/Dashboard";
import Footer from './sections/Footer.jsx';
import About from './components/About.jsx';

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<LandingPage />} />

        {/* Role-Specific Login Pages */}
        <Route path="/login/admin" element={<LoginPageAdmin />} />
        <Route path="/login/chimiste" element={<LoginPageChimiste />} />
        <Route path="/login/pharma" element={<LoginPagePharma />} />
        <Route path="/login/dev" element={<LoginPageDev />} />

        {/* Protected Routes */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute allowedRoles={["admin", "chimiste", "pharma", "dev"]}>
              <Dashboard />
            </PrivateRoute>
          }
        />

        {/* Unauthorized Access Route */}
        <Route path="/unauthorized" element={<h1>Accès non autorisé</h1>} />

        {/* Fallback Route */}
        <Route path="*" element={<h1>Page Non Trouvée</h1>} />
      </Routes>
    </Router>
  );
};

export default App;
